    __webpack_exports__["default"] = "<section class=\"banner-area relative\" appNoRightClick>\r\n        <div class=\"overlay overlay-bg\"></div>\r\n        <div class=\"banner-content text-center\">\r\n          <h1>Privacy Policy</h1>\r\n          \r\n        </div>\r\n      </section>\r\n    \r\n    <section class=\"pt-5 bg-white text-black f-3 l-space\" appNoRightClick>\r\n    \r\n      <div class=\"container\">\r\n  \r\n    <div class=\"static-wrapper\">\r\n  <div class=\"section-title text-left pb-2\">\r\n  <span style='float: right;'>Effective Date:_____2018</span>\r\n  <h3  class=\"f-18 pt-3 pb-3\">1. INTRODUCTION</h3>\r\n  <!--<p>Last Updated: November 2016</p>-->\r\n  </div>\r\n  <p>A.\tYou (\"you\") are required to read and accept all of the terms and conditions laid down in this Privacy Policy Statement (“Policy”) and the linked Terms and Conditions, before you use the website and content (“Content”)made available to you by _____________________ (hereinafter referred to as “we” or “our”). </p>\r\n<p>B.\tWe are committed to maintaining your privacy. Our privacy policy statement is given below.  If we make changes to this Policy, we will notify you by updating this Policy statement on our Website (“Website”). This Policy outlines the manner your data is collected and used by us. You are advised to please read the Policy carefully. By accessing the Content provided by the Site, you agree to the collection and use of your data by us in the manner provided in this Policy. </p>  \r\n<p>C.\tThe Policy does not apply to the procedures and practices followed by entities that are not managed, owned or controlled by us or to the people that are not engaged, employed or managed by us. Through this document, we wish to make you:</p>\r\n<p>\r\n(i)\t    Feel at ease while using our Website;</p>\r\n<p>(ii)\tFeel confident while sharing information with us;</p>\r\n<p>(iii)\tAware that you may contact us with your questions or concerns about privacy on our Website;</p>\r\n<p>(iv)\tAware that by using our website you are agreeing to the collection of certain data.</p>\r\n<p>D. For purposes of this Policy:</p>\r\n<p>(i)\t“Business partners” means all Owner - Licensors, subcontractors, vendors or other entities with which we have a relationship for constant commercial supplies, Content or information;</p>\r\n<p>(ii)\t“Information” shall include data, message, text, images, sound, voice, codes, computer programmes, software and data bases.</p>\r\n<p>(iii)\t“Personal Information” means any information which is capable of identifying you (either directly or indirectly, in combination with other information available or likely to be available with us), such as your name, phone number and email address;</p>\r\n<p>(iv)\t“Privacy Rules” means Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules, 2011 updated from time to time;</p>\r\n<p>(v)\t“Sensitive Personal Data or Information” shall have the meaning ascribed to such term under the Privacy Rules.</p>\r\n<p>2.\tINFORMATION COLLECTED</p>\r\n<p>(i)\tWe collect the details provided by you together with information we learn about you from your use of our Content and your visits to our Website and other websites accessible from them.</p>\r\n<p>(ii)\tWe may collect additional information in connection with your participation in any promotions or contests offered by us and information you provide when giving us feedback or completing profile forms. We also monitor customer traffic patterns and website use, which enables us to improve the service we provide. We will collect only such information as is necessary and relevant to us to provide you with the Content available on the Website.</p>\r\n<p>(iii)\tWhile you use our website, we may have automatic access to (receive and collect) certain anonymous information in standard usage logs through our web server, obtained from “cookies” sent to your browser from web server cookies stored on your hard drive, including but not limited to:</p>\r\n<p>(a)\tComputer-identification information;</p>\r\n<p>(b)\tIP address, assigned to the computer/mobile phone which you use;</p>\r\n<p>(c)\tThe domain server through which you access our service;</p>\r\n<p>(d)\tThe type of mobile phone/computer you're using;</p>\r\n<p>(e)\tThe type of web/mobile browser you're using.</p>\r\n<p>(v)\tWe may also collect the following information about:</p>\r\n<p>(a)\tThe pages you visit/access;</p>\r\n<p>(b)\tThe links you click on our website;</p>\r\n<p>(c)\tThe number of times you access the page/app mobile screen;</p>\r\n<p>(d)\tThings you view, add to bag, add to wish list;</p>\r\n<p>(e)\tOther websites you open simultaneously while browsing on ours.</p>\r\n\r\n <p>3.\tWHEN / HOW WE COLLECT THE INFORMATION</p>\r\n <p>(i)\tWe may collect anonymous traffic information from you when you visit our Website.</p>\r\n\r\n<p>(ii)\tWe collect the Personal Information from you when you register with us or you transact as a guest. During registration you are required to give us your contact information (such as name, email address, date of birth, gender, address, pin code, mobile number etc.) Upon registration you may receive communications from us (e.g. emails, newsletters, updates). Even when you transact as a guest we collect identifiable information (such as name, email address, date of birth, gender, billing address, delivery address, pin code, mobile number etc.).</p>\r\n\r\n<p>(iii)\tAny Information including Sensitive Personal Data or Information collected by us from you may be stored and processed in India or any other country in which we or our corporate affiliates, subsidiaries or agents maintain facilities that ensure the same level of data protection that is adhered to by us. You shall be deemed to have consented for transfer of your Information including Sensitive Personal Data or Information outside your country if you provide us your consent for collection and use of your Sensitive Personal Data of Information by us in the manner as specified in this Privacy Statement.</p>\r\n\r\n<p>(iv)\tWe assure you that any Sensitive Personal Data or Information provided by you is collected when the collection of such information is necessary and used by us for a lawful purpose connected with our function or activity. </p>\r\n\r\n<p>(v)\tWe shall be permitted to use this information to contact you about the Content you are using on our Website and Content in which you have expressed interest.</p>\r\n\r\n<p>(vi)\tWe are the sole owners of your information collected by us at different points on our Website/.</p>\r\n\r\n<p>(xii)   We will collect Personal Information about you only as part of on-line survey, or contest or any combination thereof.</p>\r\n\r\n<p>(vii)\tThe Website contains links to other websites. We are not responsible for the privacy practices of such websites which we do not own, manage or control.</p>\r\n\r\n<p>(viii)\tWe may at certain times make chat rooms, forums, instant messenger and message boards and other Content available to you. Please understand that any information that is disclosed in these areas becomes public information. We have no control over its use and you should exercise caution when disclosing your personal information to anyone.</p>\r\n\r\n<p>(ix)\tIf you use a bulletin board or chat room on our Websites, you should be aware that any Personal Information you submit there can be read, collected, or used by other users of these forums, and could be used to send you unsolicited messages. We are not responsible for the Personal Information you choose to submit in these forums.</p>\r\n  \r\n  <p>4.\tDISCLOSING PERSONAL INFORMATION</p>\r\n  <p>You agree that we may share or disclose your Information including Sensitive Personal Data or Information with corporate affiliates and business partners (a) to carry out transactions you request or to make our business or that of our corporate affiliates more responsive to your needs; (b) if we reasonably consider it necessary to protect ourselves, its customers, or the public; (c) who help us to perform transactions you request or who help us to customize, evaluate, process, analyse, and/or improve our communication or relationship with you. We impose an obligation on our corporate affiliates and business partners who receive your Sensitive Personal Data or Information to keep such information secure in accordance with the Privacy Rules and to not disclose it further to third parties. You shall be deemed to have consented to sharing and disclosure of your Information including Sensitive Personal Data or Information by us with our corporate affiliates and business partners if you give your consent to provide us with your Sensitive Personal Data of Information in the manner as specified in this Policy. We may also disclose any Information provided by you (which may include your Personal Information and Sensitive Personal Data or Information) (a) in connection with law enforcement, fraud prevention, or other legal actions or legal obligations; or (b) if required to do so under applicable law or regulation in your country or by an order under the law for the time being in force; or (c) to government agencies mandated under the law of your country to obtain such information for the purpose of verification of identity, or for prevention, detection, investigation including any real or suspected adverse event in relation to cyber security that violates any applicable security policy. No consent will be required to be obtained by us from you for any of the aforesaid disclosures. In addition, you agree that we may share your Information with business partners that help us carry out transactions you request or that help us to customize, process, evaluate, analyse, and/or improve our communication or relationship with you, and who share our commitment to protecting your Information. Except as described above, we will not disclose your Personal Information including your Sensitive Personal Data or Information to third parties for their own marketing purposes, unless you consent for the same.</p>\r\n  <p>5.\tHOW IS THE INFORMATION USED?</p>\r\n  <p>We shall use your contact information to send you Special offers; Changes in the policies or terms of use; or event based communications such as invites, reminders etc. We use your personal information to improve personalized features on our Website; or to preserve social history as governed by existing law or policy. We use anonymous traffic information to recognize your usage privileges to our Website; or track your session and activities so that we can understand better how people use our Website. </p>\r\n  <p>6.\tWHO DO WE SHARE YOUR INFORMATION WITH?</p>\r\n  <p>(i)\tWe do not share or rent your information with third parties.</p>\r\n  <p>(ii)\tWe do not rent, sell or share your Personal Information or Sensitive Personal Information and we will not disclose any of your Personal Information to any other third parties unless: </p>\r\n  <p>(a)\tRequired by special circumstances such as compliance with subpoenas, court orders, requests/order from legal authorities or law enforcement agencies requiring such disclosure; </p>\r\n  <p>(b)\tTo help investigate, prevent or take action regarding unlawful and illegal activities, suspected fraud, potential threat to the safety or security of any person, violations of terms of use or to defend against legal claims; </p>\r\n  <p>(c)\tWe have your permission; or</p>\r\n  <p>(d)\tTo provide Content requested by you.</p>\r\n  <p>(iv)\tWe reserve the right to disclose your Personal Information or Sensitive Personal Information and email address information as required by law and when we believe that disclosure is necessary to protect our rights and/or comply with a judicial proceeding, court order, or legal process served on our Website.</p>\r\n  <p>(v)\tIf we do share your information with advertisers it will strictly be on an aggregate basis only.</p>\r\n  <p>(vi)\tThe security of your personal information and email address is important to us. When you enter sensitive information (such as credit / debit card number) on our acquiring bank’s system or order forms, they encrypt that information using secure socket layer technology (SSL). To learn more about SSL, follow this link http://www.verisign.com/.  </p>\r\n  <p>(vi)\tThe security of your personal information and email address is important to us. When you enter sensitive information (such as credit / debit card number) on our acquiring bank’s system or order forms, they encrypt that information using secure socket layer technology (SSL). To learn more about SSL, follow this link http://www.verisign.com/.  </p>\r\n  <p>(vii)\tWe follow generally accepted industry standards to protect the personal information and email address submitted to us, both during transmission and once we receive it. No method of transmission over the Internet, or method of electronic storage, is 100% secure, however. Therefore, while we strive to use commercially acceptable means to protect your Personal Information and email address, we cannot guarantee its absolute security.</p>\r\n  <p>(viii)\tIf you have any questions about security on our Website you can email us at: ____________________.</p>\r\n  <p>7.\tHOW YOU CAN ACCESS YOUR INFORMATION</p>\r\n  <p>We want to maintain the Information including Personal Information and Sensitive Personal Data or Information provided by you accurately.</p>\r\n  <p><b>WE SHALL NOT BE RESPONSIBLE FOR THE AUTHENTICITY OF THE INFORMATION OR SENSITIVE PERSONAL DATA OR INFORMATION SUPPLIED BY YOU AND ALL LIABILITIES IN RESPECT OF THE LOSSES WHICH MAY OCCUR DUE TO SUCH INCORRECT PERSONAL INFORMATION OR SENSITIVE PERSONAL DATA OR INFORMATION WILL BE SOLELY ATTRIBUTABLE TO YOU.</b></p>\r\n  <p>8.\tSELECTING YOUR COMMUNICATION PREFERENCES</p>\r\n  <p>(i)\tYou may choose to receive or not receive marketing communications from us by indicating your preferences through an email at _______________________for the website. All marketing by us or any third party on behalf of us, will be conducted in accordance with applicable laws of your country.</p>\r\n  <p>(ii)\tPlease allow up to 10 business days for your email preferences to become effective.</p>\r\n  <p>(iii)\tAs some promotions, such as direct catalogues, are developed in advance, you may receive marketing communication after receiving your request preference.</p>\r\n  <p>9.\tHOW WE SECURE YOUR INFORMATION </p>\r\n  <p>We are committed to protecting the security of your Information including Personal Information and Sensitive Personal Data or Information. We use a variety of security technologies and procedures to help protect your Information, Personal Information and Sensitive Personal Data or Information from unauthorized access, usage and disclosure, such as encryption, passwords, physical security, etc. While we strive to protect such information, we cannot ensure or warrant or guarantee that your Information or private communications you transmit to us will always remain private or confidential, and you do so at your own risk. </p>\r\n  <p>10.\tCOLLECTION AND USE OF CHILDREN'S INFORMATION</p>\r\n  <p>We seriously consider the privacy of children. If you are under 18 years of age, please do not submit any Personal Information and Sensitive Personal Data or Information through our websites without the consent and / or participation of a parent or guardian. We cannot ensure, warrant or guarantee that your Information or private communications or information directly transmitted/ submitted by a child under 18 years of age, will always remain private or confidential, and you do so at your own risk. </p>\r\n  <p>11.\tCHOICES AVAILABLE REGARDING COLLECTION, USE AND DISTRIBUTION OF INFORMATION</p>\r\n  <p>(i)\tYou can accept or decline the cookies. All websites that are customizable require that you accept cookies. For information on how to set your browser to alert you to cookies, or to reject cookies, go to http://www.cookiecentral.com/</p>\r\n  <p>(ii)\tCookies: A cookie is a small text file that is stored on a user's computer for record-keeping purposes. We use cookies on this Website. We do link the information we store in cookies to any Personal Information you submit while on our Website.</p>\r\n  <p>(iii)\tWe use both session ID cookies and persistent cookies. We use session cookies to make it easier and secure for you to navigate our Website. A session ID cookie expires when you close your browser. A persistent cookie remains on your hard drive for an extended period of time. You can remove persistent cookies by following directions provided in your Internet browsers “help” file. Reference for cookies can be found at http://www.cookiecentral.com/</p>\r\n  <p>(iv)\tWe use session cookies to store the secure session and browsing preferences of the user. We set a persistent cookie to store your username and interests so you don't have to enter it more than once. Persistent cookies also enable us to track and target the interests of our users to enhance the experience on our Website.</p>\r\n  <p>(v)\tIf you reject cookies, you may still use our website, but your ability to use some areas of our website, will be limited. </p>\r\n  <p>(vi)\tUnless you voluntarily identify yourself (through registration or social sign-up, for example), we will have no way of knowing who you are, even if we assign a cookie to your computer. The only personal information a cookie can contain is information you supply. A cookie cannot read data off your hard drive.</p>\r\n  <p> (vii)\tSome of our business partners (e.g., advertisers) set cookies while delivering banners on our Website. We have no access to or control over these cookies. .</p>\r\n  <p>(vii)\tWe do use cookies on point of collection pages of email address but we do not use them in emails.</p>\r\n  <p>(viii)\tOur web servers automatically collect limited information about your computer's/mobile phone’s connection to the Internet, including your IP address/Android or iOS token , when you visit or use our Website. (Your IP address is a number that lets computers attached to the Internet know where to send you data such as the web pages you view.) Your IP address does not identify you personally. We use this information to deliver our web pages to you upon request, to tailor our Website to the interests of our customers, to measure traffic within our website and let advertisers know the geographic locations from where our visitors come.</p>\r\n  <p>(ix)\tOur Website may include links to other websites. Such websites are governed by their respective privacy policies, which are beyond our control. Once you leave our servers (you can know where you are by checking the URL in the location bar on your browser), use of any information you provide is governed by the privacy policy of the operator of the website you are visiting. That policy may differ from ours. If you can't find the privacy policy of any of these websites via a link from the website's homepage, you should contact the website directly for more information.</p>\r\n  <p>12.\tVOLUNTARY DISCLOSURE OF INFORMATION</p>\r\n  <p>(i)\tProviding us with Personal Information is entirely voluntary. </p>\r\n  <p>(ii)\tYou may change your interests at any time and may opt-in or opt-out of any marketing / promotional / newsletters mailings. </p>\r\n  <p>(iii)\tUpon request, we will remove / block your Personal Information from our database, thereby cancelling your registration. However, your Information may remain stored in archive on our servers even after the deletion or the termination of your account.</p>\r\n  <p>(v)\tIf we plan to use your Personal Information for any commercial purposes, we will notify you at the time we collect that information and allow you to opt-out of having your information used for those purposes. </p>\r\n  <p>13.\tSECURITY PROCEDURES TO PROTECT INFORMATION FROM LOSS, MISUSE OR ALTERATION</p>\r\n  <p>(i)\tTo protect your privacy and security, we will verify your identity, to the best of our abilities, beforegranting access or making changes to your Personal Information. </p>\r\n  <p>(ii)\tTo protect against the loss, misuse and alteration of the information under our control, we have in place appropriate physical, electronic and managerial procedures. For example, our servers are accessible only to authorized personnel and your information is shared with respective personnel on need to know basis to complete the transaction and to provide the Content requested by you. </p>\r\n  <p>(iii)\tAlthough we will endeavour to safeguard the confidentiality of your Personal Information, transmissions made by means of the Internet cannot be made absolutely secure. By using our  Website, you agree that we will have no liability for disclosure of your information due to errors in transmission or unauthorized acts of third parties.</p>\r\n  <p>(iv)\tWe follow generally accepted industry standards to protect the Personal Information and email addresses submitted to us, both during transmission and once we receive it. No method of transmission over the Internet, or method of electronic storage, is 100% secure, however. Therefore, while we strive to use commercially acceptable means to protect your personal information and email address, we cannot guarantee its absolute security.</p>\r\n  <p>(v)\tIf you have any questions about security on our Website, you can send email us at _____________________.</p>\r\n  <p>(vi)\tAll information gathered on the Site is securely stored within a controlled database. The database is stored on servers secured behind a firewall; access to the servers is password-protected and is strictly limited. However, as effective as our security measures are, no security system is impenetrable. We cannot guarantee the security of our database, nor can we guarantee that information you supply will not be intercepted while being transmitted to us over the Internet and, of course, any information you include in a posting to the discussion areas is available to anyone with internet access.</p>\r\n  <p>(vii)\tHowever, the internet is an ever evolving medium. We may revise our Policy from time to time to incorporate necessary changes. Of course, our use of any information we gather will always be consistent with the policy under which the information was collected, regardless of what the new policy may be.  </p>\r\n  <p>(viii)\tWe use third-party advertising companies to serve ads when you visit our website. These companies may use information (not including your name, address, email address or telephone number) about your visits to this and other websites in order to provide advertisements about goods and Content of interest to you.</p>\r\n  <p>14.\tTHIRD-PARTY WEBSITES AND CONTENT</p>\r\n  <p>Be aware that other websites that can be accessed through our website may collect your Information, Personal Information and Sensitive Personal Data or Information. The information practices of those third-party websites are not covered by this Privacy Statement. We will not be responsible for any breach of your privacy or any other loss arising to you as a result of collection of you Information, Personal Information and Sensitive Personal Data or Information by such websites. </p>\r\n  <p>Please be aware that, in providing Content on our behalf, our business partners may collect information about you to provide Content on behalf of us.</p>\r\n  <p>15.\tPOLICY UPDATES</p>\r\n  <p>(i)\tWe reserve the right to change or update this Policy at any time by placing a prominent notice on our website. Such changes shall be effective immediately upon posting to this website. </p>\r\n  <p>(ii)\tIf we make changes to this Privacy Statement or we make any material changes to the way we will use your Information including Personal Information and Sensitive Personal Data or Information, we will review the Privacy Statement to reflect such changes and also the effective date of the declaration, included at the end of this section. We reserve the right to modify this privacy statement at any time, so please review it frequently. If we make material changes to this policy, we will notify you on our homepage. </p>\r\n  <p>If we decide to make changes in our email practices, we will post those changes to this privacy policy, the homepage, and other places we deem appropriate so that you are aware of what information we collect, how we use it, and under what circumstances, if any, we disclose it.</p>\r\n  <p>We encourage you to periodically review this Privacy Statement to stay informed about how we are protecting your Information including Personal Information and Sensitive Personal Data or Information.</p>\r\n  <p>16.\tCONTACT INFORMATION</p>\r\n  <p>If you have any questions about this Site or our privacy policies, visit the front page of our website, scroll to the bottom, click 'contact us' and send an email.</p>\r\n \r\n \r\n \r\n \r\n  \r\n  \r\n  </div>\r\n      </div>\r\n    </section>";
